import React from "react";
const styles = {
  border: "1px solid black",
  textAlign: "center",
  fontFamily: "Ubuntu"
};

export default function Footer() {
  return (
    <div id="footer" style={styles}>
      <h1>Footer</h1>
    </div>
  );
}
